using System;\nusing System.Data;\nusing System.Data.SqlClient;\n\npublic class DataInserter\n{\n    private const string ConnectionString = "your_connection_string_here";\n    \n    public void InsertData()\n    {\n        // Create a DataTable with sample data.\n        var dataTable = new DataTable();\n        dataTable.Columns.Add("v", typeof(string));\n        \n        for (int i = 1; i <= 50; i++)\n        {\n            dataTable.Rows.Add($"Value {i}");\n        }\n\n        using (var bulkCopy = new SqlBulkCopy(ConnectionString))\n        {\n            bulkCopy.DestinationTableName = "tbFoo";\n            bulkCopy.ColumnMappings.Add("v", "columnNameInYourTable");\n            \n            try\n            {\n                // Write from the DataTable to the destination table.\n                bulkCopy.WriteToServer(dataTable);\n            }\n            catch (Exception ex)\n            {\n                Console.WriteLine(ex.Message);\n            }\n        }\n    }\n}